import React from 'react'
import Article from '../Article.js'
import './style.css'


export default function({ articles }) {

    var articlesElements = articles.map((article, index) => <li key={article.id} className="article-list"> <Article article={article} defaultOpen={index === 0} /></li>)

    return (
        <ul>
			{articlesElements}
		</ul>

    )
}
